import React from 'react';
import { NavLink } from 'react-router-dom';

const Header = () => {
  
   

    return (
        <nav>
            <NavLink activeStyle={{
                fontWeight:"bold",
                color:"red"
            }} to="/home">Home</NavLink>
            <NavLink to="/about">About</NavLink>
            <NavLink to="/friends">Friends</NavLink>
            <NavLink to="/"></NavLink>
        </nav>
    );
};

export default Header;
